import React, {Component} from 'react';
import ExcursionList from './excursionSelect';
// import Test from './test';
import Excursion from "./excursion";
import {Route} from "react-router-dom";

class FetchInfo extends Component{
    constructor(props){
        super(props);
        this.state={
            hide: false
        };
        this.hideMe = this.hideMe.bind(this);
    }

    hideMe(){
        this.setState({hide: !this.state.hide})
    }

    render(){
        if(this.state.hide === false){
            return(
                <section className={'hero'}>
                    <ExcursionList data={this.props.data}  hide={this.hideMe}/>
                </section>
            )
        }else {
            return(
                <Route path="/excursion" render={(props)=><Excursion {...props} data={this.state.response} country={this.props.country} destination={this.props.destination} hide={this.hideMe}/>} />
            )
        }

    }
}

export default FetchInfo;
